import me from './mee.jpg';
import './App.css';
import Navbar from './Navbar';
import ConsoleWindow from './Console';

function App() {
  return (
      <div className="flex justify-between">
        <Navbar />
          <div className="w-72">
            <p>Hi there, Shubhada here</p>
            <img src={me} className="me" alt="Image" />
          </div>
          <div>
            <ConsoleWindow />
          </div>
      </div>

  );
}

export default App;
